    private static void check(String[] w1, String[] w2, int expected) throws Exception {
        System.out.println("weight1:" + Arrays.toString(w1));
        System.out.println("weight2:" + Arrays.toString(w2));
        DoubleWeights doubleWeights = new DoubleWeights();
        int actual = doubleWeights.minimalCost(w1, w2);
        if (expected == actual) {
            return;
        }
        System.out.flush();
        throw new Exception("expected " + expected + " actual " + actual);
    }

    private int minimalCost(String[] weight1, String[] weight2) {
        this.weight1 = weight1;
        this.weight2 = weight2;
        HashSet<Integer> visited = new HashSet<>();
        PriorityQueue<Candidate> toVisit = new PriorityQueue<>();
        toVisitElements = new HashMap<>();
        toVisit.add(new Candidate(0, 0, 0));
        while (!toVisit.isEmpty()) {
            Candidate c = toVisit.poll();
            System.out.println("checking candidate " + c);
            if (c.getId() == 1) {
                return c.getCostTotal();
            }
            visited.add(c.getId());
            for (Candidate next : getNexts(c)) {
                if (visited.contains(next.getId())) {
                    continue;
                }
                if (toVisit.contains(next)) {
                    updateCost(toVisit, next);
                    continue;
                }
                toVisit.add(next);
                toVisitElements.put(next.getId(), next);
            }
        }

        return -1;
    }

    private void updateCost(PriorityQueue<Candidate> toVisit, Candidate next) {
        Candidate current = toVisitElements.get(next.getId());
        if (current.getCostTotal() <= next.getCostTotal()) {
            return;
        }
        toVisit.remove(current);
        toVisit.add(next);
        toVisitElements.put(next.getId(), next);
    }

    private LinkedList<Candidate> getNexts(Candidate c) {
        LinkedList<Candidate> nexts = new LinkedList<>();
        int id = c.getId();
        String currWeight1 = weight1[id];
        String currWeight2 = weight2[id];

        for (int i = 0; i < currWeight1.length(); i++) {
            char w1 = currWeight1.charAt(i);
            char w2 = currWeight2.charAt(i);
            if (w1 == '.') {
                continue;
            }
            int cost1 = w1 - '0';
            int cost2 = w2 - '0';

            Candidate next = new Candidate(i, c, cost1, cost2);
            nexts.add(next);
        }
        return nexts;
    }


    class Candidate implements Comparable<Candidate> {
        private int id;
        private int cost1;
        private int cost2;

        Candidate(int id, int cost1, int cost2) {
            this.id = id;
            this.cost1 = cost1;
            this.cost2 = cost2;
        }

        Candidate(int id, Candidate c, int w1, int w2) {
            this.id = id;
            this.cost1 = c.cost1 + w1;
            this.cost2 = c.cost2 + w2;
        }

        int getId() {
            return id;
        }

        int getCostTotal() {
            return cost1 * cost2;
        }

        public boolean equals(Object other) {
            return equals((Candidate) other);
        }

        boolean equals(Candidate other) {
            return other.id == this.id;
        }

        public int compareTo(Candidate c) {
            return this.getCostTotal() - c.getCostTotal();
        }

        @Override
        public String toString() {
            return "Candidate{" +
                    "id=" + id +
                    ", cost1=" + cost1 +
                    ", cost2=" + cost2 +
                    '}';
        }
    }
